import styled from 'styled-components'
import Image from 'next/image'

const Home = () => {

    return (
        <Container>
            <Image
                src="/coding_.png"
            />
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
`

export default Home
